/* -------------------------- ofBlSquare~ ------------------------------ */
static t_class *ofeliaBlSquare_class;

typedef struct _ofeliaBlSquare
{
    t_object x_obj;
    t_float x_fnpoints;
    t_float x_finvnpoints;
    t_float x_f;
    double x_phase, x_phase2;
    t_float x_conv, x_conv2;
    t_float x_nyquist;
    
} t_ofeliaBlSquare;

void *ofeliaBlSquare_new(t_floatarg f)
{
    t_ofeliaBlSquare *x = (t_ofeliaBlSquare *)pd_new(ofeliaBlSquare_class);
    x->x_f = f;
    x->x_phase = x->x_phase2 = 0.0;
    x->x_conv = x->x_conv2 = 0.0;
    x->x_fnpoints = 512.;
    x->x_finvnpoints = (1./512.);
    inlet_new(&x->x_obj, &x->x_obj.ob_pd, &s_float, gensym("ft1"));
    outlet_new(&x->x_obj, &s_signal);
    return (x);
}

t_int *ofeliaBlSquare_perform(t_int *w)
{
    t_ofeliaBlSquare *x = (t_ofeliaBlSquare *)(w[1]);
    t_float *in = (t_float *)(w[2]);
    t_float *out = (t_float *)(w[3]);
    int n = (int)(w[4]);
    const t_float nyquist = x->x_nyquist;
    int normhipart, normhipart2;
    union tabfudge tf, tf2;
    double dphase, dphase2;
    float conv, conv2;
    
    /* phasor~ */
    dphase = x->x_phase + (double)UNITBIT32;
    conv = x->x_conv;
    tf.tf_d = UNITBIT32;
    normhipart = tf.tf_i[HIOFFSET];
    tf.tf_d = dphase;
    
    /* tabosc4~ */
    t_float fnpoints = x->x_fnpoints;
    int mask = fnpoints - 1;
    conv2 = fnpoints * x->x_conv2;
    dphase2 = fnpoints * x->x_phase2 + (double)UNITBIT32;
    tf2.tf_d = UNITBIT32;
    normhipart2 = tf2.tf_i[HIOFFSET];
    
    int isBandlimited = -1;
    
    int i;
    for (i=0; i<n; ++i) {
        
        /* bandlimited numHarmonics range 1~10 */
        const int numHarmonics = (int)(((int)(nyquist/in[i])-1)*0.5f+1);
        
        if (numHarmonics > 10) {
            
            /* sync phase when changed */
            if (isBandlimited == 1) {
                
                tf2.tf_d = UNITBIT32 * fnpoints;
                normhipart2 = tf2.tf_i[HIOFFSET];
                tf2.tf_d = dphase2 + (UNITBIT32 * fnpoints - UNITBIT32);
                tf2.tf_i[HIOFFSET] = normhipart2;
                x->x_phase2 = (tf2.tf_d - UNITBIT32 * fnpoints) * x->x_finvnpoints;
                x->x_phase = x->x_phase2;
                dphase = x->x_phase + (double)UNITBIT32;
                tf.tf_d = dphase;
            }
            isBandlimited = 0;
            
            /* phasor~ */
            tf.tf_i[HIOFFSET] = normhipart;
            dphase += in[i] * conv;
            const float phasor = tf.tf_d - UNITBIT32;
            
            /* output raw waveform */
            if (phasor < 0.5f)
                out[i] = 1.0f;
            else
                out[i] = -1.0f;
            tf.tf_d = dphase;
        }
        else {
            
            /* sync phase when changed */
            if (isBandlimited == 0) {
                
                x->x_phase2 = tf.tf_d - UNITBIT32;
                dphase2 = fnpoints * x->x_phase2 + (double)UNITBIT32;
            }
            isBandlimited = 1;
            
            /* tabosc4~ */
            t_sample frac, a, b, c, d, cminusb;
            tf2.tf_d = dphase2;
            dphase2 += in[i] * conv2;
            
            if (numHarmonics > 0) {
                
                t_float *addr = blsquareTab[(size_t)(numHarmonics-1)] + (tf2.tf_i[HIOFFSET] & mask);
                tf2.tf_i[HIOFFSET] = normhipart2;
                frac = tf2.tf_d - UNITBIT32;
                a = addr[0];
                b = addr[1];
                c = addr[2];
                d = addr[3];
                cminusb = c-b;
                
                /* output bandlimited waveform */
                out[i] = b + frac * (cminusb - 0.1666667f * (1.-frac) * ((d - a - 3.0f * cminusb) * frac + (d + 2.0f*a - 3.0f*b)));
            }
            else {
                
                /* mute when frequency is above nyquist */
                out[i] = 0.0f;
            }
        }
    }
    /* phasor~ */
    tf.tf_i[HIOFFSET] = normhipart;
    x->x_phase = tf.tf_d - UNITBIT32;
    
    /* tabosc4~ */
    tf2.tf_d = UNITBIT32 * fnpoints;
    normhipart2 = tf2.tf_i[HIOFFSET];
    tf2.tf_d = dphase2 + (UNITBIT32 * fnpoints - UNITBIT32);
    tf2.tf_i[HIOFFSET] = normhipart2;
    x->x_phase2 = (tf2.tf_d - UNITBIT32 * fnpoints) * x->x_finvnpoints;
    return (w+5);
}

void ofeliaBlSquare_dsp(t_ofeliaBlSquare *x, t_signal **sp)
{
    x->x_conv = x->x_conv2 = 1./sp[0]->s_sr;
    x->x_nyquist = sp[0]->s_sr * 0.5f;
    dsp_add(ofeliaBlSquare_perform, 4, x, sp[0]->s_vec, sp[1]->s_vec, sp[0]->s_n);
}

