/* -------------------------- ofBlPulse~ ------------------------------ */
static t_class *ofeliaBlPulse_class;

typedef struct _ofeliaBlPulse
{
    t_object x_obj;
    t_float x_fnpoints, x_fnpoints2;
    t_float x_finvnpoints, x_finvnpoints2;
    t_float x_f;
    double x_phase, x_phase2, x_phase3;
    t_float x_conv, x_conv2, x_conv3;
    t_float x_nyquist;
    
} t_ofeliaBlPulse;

void *ofeliaBlPulse_new(t_floatarg f)
{
    t_ofeliaBlPulse *x = (t_ofeliaBlPulse *)pd_new(ofeliaBlPulse_class);
    x->x_f = f;
    x->x_phase = x->x_phase2 = x->x_phase3 = 0.0;
    x->x_conv = x->x_conv2 = x->x_conv3 = 0.0f;
    x->x_fnpoints = x->x_fnpoints2 = 512.0f;
    x->x_finvnpoints = x->x_finvnpoints2 = 1.0f/512.0f;
    inlet_new(&x->x_obj, &x->x_obj.ob_pd, &s_signal, &s_signal);
    inlet_new(&x->x_obj, &x->x_obj.ob_pd, &s_float, gensym("ft1"));
    outlet_new(&x->x_obj, &s_signal);
    return (x);
}

t_int *ofeliaBlPulse_perform(t_int *w)
{
    t_ofeliaBlPulse *x = (t_ofeliaBlPulse *)(w[1]);
    t_float *in1 = (t_float *)(w[2]);
    t_float *in2 = (t_float *)(w[3]);
    t_float *out = (t_float *)(w[4]);
    int n = (int)(w[5]);
    const t_float nyquist = x->x_nyquist;
    int normhipart, normhipart2, normhipart3;
    union tabfudge tf, tf2, tf3;
    double dphase, dphase2, dphase3;
    float conv, conv2, conv3;
    const t_float modin2 = in2[0] * 0.5f + 0.5f;
    const t_float pw = modin2 - floorf(modin2);
    const t_float ipw = 1.0f - pw;
    
    /* phasor~ */
    dphase = x->x_phase + (double)UNITBIT32;
    conv = x->x_conv;
    tf.tf_d = UNITBIT32;
    normhipart = tf.tf_i[HIOFFSET];
    tf.tf_d = dphase;
    
    /* tabosc4~ */
    t_float fnpoints = x->x_fnpoints;
    int mask = fnpoints - 1;
    conv2 = fnpoints * x->x_conv2;
    dphase2 = fnpoints * x->x_phase2 + (double)UNITBIT32;
    tf2.tf_d = UNITBIT32;
    normhipart2 = tf2.tf_i[HIOFFSET];
    
    /* tabosc4~ */
    t_float fnpoints2 = x->x_fnpoints2;
    int mask2 = fnpoints2 - 1;
    conv3 = fnpoints2 * x->x_conv3;
    x->x_phase3 = x->x_phase2 + ipw;
    dphase3 = fnpoints2 * x->x_phase3 + (double)UNITBIT32;
    tf3.tf_d = UNITBIT32;
    normhipart3 = tf3.tf_i[HIOFFSET];
    
    int isBandlimited = -1;
    
    int i;
    for (i=0; i<n; ++i) {
        
        /* bandlimited numHarmonics range 1~20 */
        const int numHarmonics = (int)(nyquist/in1[i]);
        
        if (numHarmonics > 20) {
            
            /* sync phase when changed */
            if (isBandlimited == 1) {
                
                tf2.tf_d = UNITBIT32 * fnpoints;
                normhipart2 = tf2.tf_i[HIOFFSET];
                tf2.tf_d = dphase2 + (UNITBIT32 * fnpoints - UNITBIT32);
                tf2.tf_i[HIOFFSET] = normhipart2;
                x->x_phase2 = (tf2.tf_d - UNITBIT32 * fnpoints) * x->x_finvnpoints;
                x->x_phase = x->x_phase2;
                dphase = x->x_phase + (double)UNITBIT32;
                tf.tf_d = dphase;
            }
            isBandlimited = 0;
            
            /* phasor~ */
            tf.tf_i[HIOFFSET] = normhipart;
            dphase += in1[i] * conv;
            const float phasor = tf.tf_d - UNITBIT32;
            const t_float modin3 = in2[i] * 0.5f + 0.5f;
            const t_float pw2 = modin3 - floorf(modin3);
            
            /* output raw waveform */
            if (phasor < pw2)
                out[i] = 1.0f;
            else
                out[i] = -1.0f;
            tf.tf_d = dphase;
        }
        else {
            
            /* sync phase when changed */
            if (isBandlimited == 0) {
                
                x->x_phase2 = tf.tf_d - UNITBIT32;
                dphase2 = fnpoints * x->x_phase2 + (double)UNITBIT32;
                
                const double modphase = x->x_phase2 + ipw + 1.0;
                x->x_phase3 = modphase - floor(modphase);
                dphase3 = fnpoints2 * x->x_phase3 + (double)UNITBIT32;
            }
            isBandlimited = 1;
            
            /* tabosc4~ */
            t_sample frac, a, b, c, d, cminusb;
            tf2.tf_d = dphase2;
            dphase2 += in1[i] * conv2;
            
            /* tabosc4~ */
            t_sample frac2, a2, b2, c2, d2, cminusb2;
            tf3.tf_d = dphase3;
            dphase3 += in1[i] * conv3;
            
            if (numHarmonics > 0) {
                
                t_float *addr = blsawTab[(size_t)(numHarmonics-1)] + (tf2.tf_i[HIOFFSET] & mask);
                tf2.tf_i[HIOFFSET] = normhipart2;
                frac = tf2.tf_d - UNITBIT32;
                a = addr[0];
                b = addr[1];
                c = addr[2];
                d = addr[3];
                cminusb = c-b;
                
                t_float *addr2 = blsawTab[(size_t)(numHarmonics-1)] + (tf3.tf_i[HIOFFSET] & mask2);
                tf3.tf_i[HIOFFSET] = normhipart3;
                frac2 = tf3.tf_d - UNITBIT32;
                a2 = addr2[0];
                b2 = addr2[1];
                c2 = addr2[2];
                d2 = addr2[3];
                cminusb2 = c2-b2;
                
                /* output bandlimited waveform */
                const t_float tabOut = b + frac * (cminusb - 0.1666667f * (1.-frac) * ((d - a - 3.0f * cminusb) * frac + (d + 2.0f*a - 3.0f*b)));
                const t_float tabOut2 = b2 + frac2 * (cminusb2 - 0.1666667f * (1.-frac2) * ((d2 - a2 - 3.0f * cminusb2) * frac2 + (d2 + 2.0f*a2 - 3.0f*b2)));
                out[i] = (tabOut - tabOut2) + (pw - 0.5) * 2.0;
            }
            else {
                
                /* mute when frequency is above nyquist */
                out[i] = 0.0f;
            }
        }
    }
    /* phasor~ */
    tf.tf_i[HIOFFSET] = normhipart;
    x->x_phase = tf.tf_d - UNITBIT32;
    
    /* tabosc4~ */
    tf2.tf_d = UNITBIT32 * fnpoints;
    normhipart2 = tf2.tf_i[HIOFFSET];
    tf2.tf_d = dphase2 + (UNITBIT32 * fnpoints - UNITBIT32);
    tf2.tf_i[HIOFFSET] = normhipart2;
    x->x_phase2 = (tf2.tf_d - UNITBIT32 * fnpoints) * x->x_finvnpoints;
    
    /* tabosc4~ */
    tf3.tf_d = UNITBIT32 * fnpoints2;
    normhipart3 = tf3.tf_i[HIOFFSET];
    tf3.tf_d = dphase3 + (UNITBIT32 * fnpoints2 - UNITBIT32);
    tf3.tf_i[HIOFFSET] = normhipart3;
    x->x_phase3 = (tf3.tf_d - UNITBIT32 * fnpoints2) * x->x_finvnpoints2;
    return (w+6);
}

void ofeliaBlPulse_dsp(t_ofeliaBlPulse *x, t_signal **sp)
{
    x->x_conv = x->x_conv2 = x->x_conv3 = 1./sp[0]->s_sr;
    x->x_nyquist = sp[0]->s_sr * 0.5f;
    dsp_add(ofeliaBlPulse_perform, 5, x, sp[0]->s_vec, sp[1]->s_vec, sp[2]->s_vec, sp[0]->s_n);
}

