/* ________________________________________________________________________________
 * filters
 */
float clampf(const float value, const float min, const float max) {
    
    return value < min ? min : value > max ? max : value;
}

/* -------------------------- ofLowPass~ ------------------------------ */
static t_class *ofeliaLowPass_class;

typedef struct _ofeliaLowPass
{
    t_object x_obj;
    t_float x_f;
    t_float x_sr;
    t_float x_nyquist;
    t_float a0, a1, a2, a3, a4;
    t_float x1, x2, y1, y2;
    
} t_ofeliaLowPass;

void *ofeliaLowPass_new()
{
    t_ofeliaLowPass *x = (t_ofeliaLowPass *)pd_new(ofeliaLowPass_class);
    x->x_f = 0.0f;
    x->x1 = x->x2 = x->y1 = x->y2 = 0.0f;
    inlet_new(&x->x_obj, &x->x_obj.ob_pd, &s_signal, &s_signal);
    inlet_new(&x->x_obj, &x->x_obj.ob_pd, &s_signal, &s_signal);
    outlet_new(&x->x_obj, &s_signal);
    return (x);
}

t_int *ofeliaLowPass_perform(t_int *w)
{
    t_ofeliaLowPass *x = (t_ofeliaLowPass *)(w[1]);
    t_float *in1 = (t_float *)(w[2]);
    t_float *in2 = (t_float *)(w[3]);
    t_float *in3 = (t_float *)(w[4]);
    t_float *out = (t_float *)(w[5]);
    int n = (int)(w[6]);
    
    /* pull out the state into local variables */
    const t_float sr = x->x_sr;
    const t_float nyquist = x->x_nyquist;
    t_float x1 = x->x1;
    t_float x2 = x->x2;
    t_float y1 = x->y1;
    t_float y2 = x->y2;
    
    int i;
    for (i=0; i<n; ++i) {
        
        /* get the current sample */
        const t_float x0 = in1[i];
        
        /* clamp cutoff and resonance */
        const t_float cutoff = clampf(in2[i], 10.0f, nyquist-10.0f);
        const t_float res = powf(10.0f, clampf(in3[i], 0.0f, 40.0f) * 0.05f);
        
        /* setup variables */
        const t_float omega = 2.0f * M_PI * cutoff / sr;
        const t_float cs = cosf(omega);
        const t_float alpha = sinf(omega) / (2.0f * res);
        const t_float b1 = 1.0f - cs;
        const t_float b0 = b1 * 0.5f;
        const t_float b2 = b0;
        const t_float a0 = 1.0f + alpha;
        const t_float a1 = -2.0f * cs;
        const t_float a2 = 1.0f - alpha;
        
        /* compute result */
        const t_float y0 = (b0/a0)*x0 + (b1/a0)*x1 + (b2/a0)*x2 - (a1/a0)*y1 - (a2/a0)*y2;
        
        /* filter out NaN */
        if (!PD_BIGORSMALL(y0))
            out[i] = y0;
        else
            out[i] = 0.0f;
        
        /* shift x1 to x2, sample to x1 */
        x2 = x1;
        x1 = x0;
        
        /* shift y1 to y2, result to y1 */
        y2 = y1;
        y1 = out[i];
    }
    
    /* save the state for future processing */
    x->x1 = x1;
    x->x2 = x2;
    x->y1 = y1;
    x->y2 = y2;
    return (w+7);
}

void ofeliaLowPass_dsp(t_ofeliaLowPass *x, t_signal **sp)
{
    x->x_sr = sp[0]->s_sr;
    x->x_nyquist = x->x_sr * 0.5f;
    dsp_add(ofeliaLowPass_perform, 6, x, sp[0]->s_vec, sp[1]->s_vec, sp[2]->s_vec, sp[3]->s_vec, sp[0]->s_n);
}

void ofeliaLowPass_setup(void)
{
    ofeliaLowPass_class = class_new(gensym("ofLowPass~"), (t_newmethod)ofeliaLowPass_new, 0,
                                    sizeof(t_ofeliaLowPass), 0, A_NULL, 0);
    CLASS_MAINSIGNALIN(ofeliaLowPass_class, t_ofeliaLowPass, x_f);
    class_addmethod(ofeliaLowPass_class, (t_method)ofeliaLowPass_dsp, gensym("dsp"), A_CANT, 0);
}

